import React from "react";
import { useNavigate } from "react-router-dom";

const PersonalInfoBar = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Örnek: localStorage'dan token temizle
    localStorage.removeItem("token");
    // Veya gerekli başka temizlik işlemleri

    // Login sayfasına yönlendir
    navigate("/login");
  };

  return (
    <div
      style={{
        backgroundColor: "#2E7D32",
        padding: "10px 30px",
        color: "white",
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
        width: "100vw",
        boxSizing: "border-box",
      }}
    >
      {/* Sol: Logo */}
      <img
        src="/images/istun_logo.png"
        alt="İstun Logo"
        style={{
          height: "40px",
          transform: "scale(1.8)",
          transformOrigin: "left center",
        }}
      />

      {/* Orta: Metin */}
      <div
        style={{
          flex: 1,
          textAlign: "center",
          fontStyle: "italic",
          fontSize: "20px",
          color: "#fff",
        }}
      >
        Erken teşhis hayat kurtarır!
      </div>

      {/* Sağ: Çıkış Yap Butonu */}
      <button
        onClick={handleLogout}
        style={{
          backgroundColor: "#cc0000",
          color: "white",
          padding: "10px 20px",
          borderRadius: "5px",
          border: "none",
          fontWeight: "bold",
          fontSize: "14px",
          cursor: "pointer",
        }}
      >
        Çıkış Yap
      </button>
    </div>
  );
};

export default PersonalInfoBar;
